import React from 'react';
import './css/tourist.css'

interface tourType {
    name: string;
    location: string;
    email: string;
    profpic: string;
}

export function TouristDet(props:tourType){
    return <div>
        <img src={props.profpic}/>
        {props.name}
        {props.location}
        {props.email}
    </div>
};
